export const S = 'SHOW_TASKLIST'

export const loadDashboard =() =>dispatch => {
    fetch('http://localhost:5000/api/tasklist')
        .then(res => res.json())
        .then(lists => dispatch({
            type: DASHBOARD_LOADED,
            payload: lists
        }))
}
